import React from 'react';
import SpyLogo from './spyLogo.jpg';
import $ from 'jquery';
import "../css/Welcome.css";

class Final extends React.Component {
    componentDidMount() {
        $(document).ready(function () {
            $("#final").hide().delay(3000).fadeIn(100);
        });
    }

    render() {
        return (
            <div className="welcome">
                <h1 align="center">Congratulations Agent!</h1>
                <img className="app-logo" src={SpyLogo} alt="logo"/><br/>
                <h3 id="final" className="success-text">You have successfully completed your missions!</h3>
            </div>
        );
    }
}

export default Final;
